import React,{Component} from 'react';
class Row extends Component{
constructor(props) {
    super(props);
        this.state={items:[]}
      }
render(){
    const width = 960;
    const height = 16;
return(
<div>
    <div className="Table">
        <div className="Row">
            <div className="Cell">
            {this.props.dataset}
            </div>
            <div className="Cell">
            <svg width={width} height={height}> 
            {
                this.props.data.map((d, i) => (<rect key={i} fill="white" x={i*18} y={0} width='18' height="18" strokeWidth=".1" stroke="black" > </rect>))
            }
            </svg>
            </div>
        </div>
        </div>        
</div>
)
}}
export default Row;
